import React from 'react'
import { List, Modal } from '@react95/core'

const noRefCheck = function a(){}

const Index = () => (
  <div>
    <p>Hello to next.js</p>
    <Modal
      buttons={[
        {
          onClick: noRefCheck,
          value: 'Ok'
        },
        {
          onClick: noRefCheck,
          value: 'Cancel'
        }
      ]}
      buttonsAlignment="flex-end"
      closeModal={noRefCheck}
      defaultPosition={{
        x: 0,
        y: 20
      }}
      height="200"
      icon="computer"
      menu={[
        {
          list: <List width={200}><List.Item onClick={noRefCheck}>Exit</List.Item></List>,
          name: 'File'
        },
        {
          list: <List width={200}><List.Item>Copy</List.Item></List>,
          name: 'Edit'
        }
      ]}
      title="Browse"
      width="300" />
  </div>
)

export default Index
